syntax = "proto3";
package fanxi;
import "RestfulBaseRequest.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "LoginRequestProto";

message LoginRequest {
   RestfulBaseRequest baseReq=1;
   string gcmId=2;
   string userName=3;
   string password=4;
   int32 partnerId=5;
}
